import { gql } from '@apollo/client';

export const CREATE_HAIKU_MUTATION = gql`
  mutation createHaiku($content: String!) {
    createHaikus(content: $content) {
        id
        content
        collected
        submitted
        featured
        createdAt
    } {
      haiku {
        author
      }
    }
  }
`
